@SergeantSargeMcFly A new game or a spin-off being radically different is good. GREAT even.
A SEQUEL being radically different is just stupid. People will go into it with the perfectly reasonable expectation that it will be more of the same, and then be reasonably upset when it is nothing like its predecessors.
Like, imagine if the next Mario Kart was a fighting game. That would be fucking retarded, right?

@xirawito I like to say that criticizing a game for being different is as contradictory as criticisms can get. Innovation is almost always a pro, not a con.

Also. You can't just focus on gameplay if you want to fully enjoy Super Paper Mario. Appreciate its beautiful atmosphere, story and soundtrack as well.

Because honestly, people who only play games for the gameplay are no better than those who only play them for the graphics.
